import React from "react";

const History = () => {
  // Mock data: Replace with actual backend data when available
  const mockHistory = [
    { id: 1, fileName: "audio1.mp3", transcription: "This is the transcription for audio1." },
    { id: 2, fileName: "audio2.mp3", transcription: "This is the transcription for audio2." },
  ];

  return (
    <div className="container">
      <h2 className="text-lg font-bold mb-4">Transcription History</h2>
      {mockHistory.length > 0 ? (
        <ul className="space-y-4">
          {mockHistory.map((item) => (
            <li
              key={item.id}
              className="p-4 bg-white rounded-lg shadow-md border border-gray-200"
            >
              <p>
                <strong>File Name:</strong> {item.fileName}
              </p>
              <p>
                <strong>Transcription:</strong> {item.transcription}
              </p>
            </li>
          ))}
        </ul>
      ) : (
        <p className="text-gray-500">No history available yet.</p>
      )}
    </div>
  );
};

export default History;
